package Dateien;

public class Afg5_Matrix {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//keine Eingabe
		//Es soll eine 10x10-Matrix Zahlen von 00 bis 99
		//mit Hilfe von zwei for-Schleifen
		//VERARBEITUNG
		for(int i=0;i<10;i++) {
			for(int j=0;j<10;j++) {
				System.out.print(" " + i + j);
			}
			System.out.println();
		}
	}
}
